  render() {
    return (
      <Consumer>
        {value =>{
          return(
            <div className="card card-body mb-4 p-4">
            <h1 className="display-4 text-center">
            <i class="fas fa-university"></i> Search For A Masterpiece
            </h1>
            <p className="lead text-center">Find a piece of art at Rijksmuseum</p>
            <form ></form>
            </div>
          )
        }}
      </Consumer>
    )
  }
}

export default Search;
